import { View, Image } from "react-native";
import viewProps from "../MesStyles/ViewProps";
import imageProps from "../MesStyles/ImageProps";


function Header() {
    return (
        <View style={viewProps.header}>
            <Image style={imageProps.logoApp} source={require('../MesImages/logoApp.jpg')} />
        </View>
    );
}

export default Header;
